import styled from 'styled-components';

function KatePage () {
    return(
        <Background>
            <Title>Hi Kate!</Title>
        </Background>
    );
}

const Background = styled.div`
    height: 100vh;
    width: 100%;
    background: pink;
    display: flex;
    justify-content: center;

`;

const Title = styled.h1`
    height:  auto;
    margin-top: 100px;
    color: white;
    font-size: 112px;
    background: white;
`;

export default KatePage;
